INSERT INTO `species` VALUES (1,1,'','A strange seed was\nplanted on its\nback at birth. The plant sprouts\nand grows with\nthis POKMON.','medium-slow',50,45,1),(2,1,'','A strange seed was\nplanted on its\nback at birth. The plant sprouts\nand grows with\nthis POKMON.','medium-slow',50,45,1),(3,2,'','When the bulb on\nits back grows\nlarge, it appears to lose the\nability to stand\non its hind legs.','medium-slow',50,45,1),(4,3,'','The plant blooms\nwhen it is\nabsorbing solar energy. It stays\non the move to\nseek sunlight.','medium-slow',50,45,1),(5,4,'','Obviously prefers\nhot places. When\nit rains, steam is said to spout\nfrom the tip of\nits tail.','medium-slow',50,45,1),(6,5,'','When it swings\nits burning tail,\nit elevates the temperature to\nunbearably high\nlevels.','medium-slow',50,45,1),(7,6,'','Spits fire that\nis hot enough to\nmelt boulders. Known to cause\nforest fires\nunintentionally.','medium-slow',50,45,1),(8,7,'','After birth, its\nback swells and\nhardens into a shell. Powerfully\nsprays foam from\nits mouth.','medium-slow',50,45,1),(9,8,'','Often hides in\nwater to stalk\nunwary prey. For swimming fast, it\nmoves its ears to\nmaintain balance.','medium-slow',50,45,1),(10,9,'','A brutal POKMON\nwith pressurized\nwater jets on its shell. They are\nused for high\nspeed tackles.','medium-slow',50,45,1),(11,10,'','\n\n','medium',50,255,4),(12,11,'','This POKMON is\nvulnerable to\nattack while its shell is soft,\nexposing its weak\nand tender body.','medium',50,120,4),(13,12,'','In battle, it\nflaps its wings\nat high speed to release highly\ntoxic dust into\nthe air.','medium',50,45,4),(14,13,'','Often found in\nforests, eating\nleaves. It has a sharp\nvenomous stinger\non its head.','medium',70,255,4),(15,14,'','Almost incapable\nof moving, this\nPOKMON can only harden its shell\nto protect itself\nfrom predators.','medium',70,120,4),(16,15,'','It has three poisonous stingers on its forelegs and\nits tail. They are used to jab its enemy repeatedly.','medium',70,45,4),(17,16,'','A common sight in\nforests and woods.\nIt flaps its wings at ground\nlevel to kick up\nblinding sand.','medium-slow',70,255,4),(18,17,'','Very protective\nof its sprawling\nterritorial area, this POKMON will\nfiercely peck at\nany intruder.','medium-slow',70,120,4),(19,18,'','When hunting, it\nskims the surface\nof water at high speed to pick off\nunwary prey such\nas MAGIKARP.','medium-slow',70,45,4),(20,19,'','\n\n','medium',70,255,4),(21,20,'','Ses pattes arrire lui permettent de traverser les\nrivires. Il est toujours en qute de nourriture.','medium',70,127,4),(22,21,'','It flaps its small wings busily to\nfly. Using its beak, it searches\nin grass for prey.','medium',70,255,4),(23,22,'','With its huge and\nmagnificent wings,\nit can keep aloft without ever\nhaving to land\nfor rest.','medium',70,90,4),(24,23,'','Moves silently\nand stealthily.\nEats the eggs of birds, such as\nPIDGEY and\nSPEAROW, whole.','medium',70,255,4),(25,24,'','It is rumored that\nthe ferocious\nwarning markings on its belly\ndiffer from area\nto area.','medium',70,90,4),(26,25,'','When several of\nthese POKMON\ngather, their electricity could\nbuild and cause\nlightning storms.','medium',50,190,4),(27,26,'','Its long tail serves as a ground to protect itself\nfrom its own high-voltage power.','medium',50,75,4),(28,27,'','Burrows deep\nunderground in\narid locations far from water.\nIt only emerges\nto hunt for food.','medium',50,255,4),(29,28,'','Curls up into a\nspiny ball when\nthreatened. It can roll while\ncurled up to\nattack or escape.','medium',50,90,4),(30,29,'','Although small,\nits venomous\nbarbs render this POKMON dangerous.\nThe female has\nsmaller horns.','medium-slow',50,235,8),(31,30,'','The female\'s horn\ndevelops slowly.\nPrefers physical attacks such as\nclawing and\nbiting.','medium-slow',50,120,8),(32,31,'','Its hard scales\nprovide strong\nprotection. It uses its hefty\nbulk to execute\npowerful moves.','medium-slow',50,45,8),(33,32,'','Stiffens its ears\nto sense danger.\nThe larger its horns, the more\npowerful its\nsecreted venom.','medium-slow',50,235,0),(34,33,'','\n\n','medium-slow',50,120,0),(35,34,'','It uses its\npowerful tail in\nbattle to smash, constrict, then\nbreak the prey\'s\nbones.','medium-slow',50,45,0),(36,35,'','Its magical and\ncute appeal has\nmany admirers. It is rare and\nfound only in\ncertain areas.','fast',140,150,6),(37,36,'','A timid fairy\nPOKMON that is\nrarely seen. It will run and hide\nthe moment it\nsenses people.','fast',140,25,6),(38,37,'','At the time of\nbirth, it has\njust one tail. The tail splits\nfrom its tip as\nit grows older.','medium',50,190,6),(39,38,'','Very smart and\nvery vengeful.\nGrabbing one of its many tails\ncould result in a\n1000-year curse.','medium',50,75,6),(40,39,'','When its huge eyes\nlight up, it sings\na mysteriously soothing melody\nthat lulls its\nenemies to sleep.','fast',50,170,6),(41,40,'','The body is soft\nand rubbery. When\nangered, it will suck in air and\ninflate itself to\nan enormous size.','fast',50,50,6),(42,41,'','\n\n','medium',50,255,4),(43,42,'','Once it strikes,\nit will not stop\ndraining energy from the victim\neven if it gets\ntoo heavy to fly.','medium',50,90,4),(44,43,'','During the day,\nit keeps its face\nburied in the ground. At night,\nit wanders around\nsowing its seeds.','medium-slow',50,255,4),(45,44,'','The fluid that\noozes from its\nmouth isn\'t drool. It is a nectar\nthat is used to\nattract prey.','medium-slow',50,120,4),(46,45,'','It has the worlds largest petals. With every step,\nthe petals shake out heavy clouds of toxic pollen.','medium-slow',50,45,4),(47,46,'','Burrows to suck\ntree roots. The\nmushrooms on its back grow by draw\ning nutrients from\nthe bug host.','medium',70,190,4),(48,47,'','A host-parasite\npair in which the\nparasite mushroom has taken over the\nhost bug. Prefers\ndamp places.','medium',70,75,4),(49,48,'','Lives in the\nshadows of tall\ntrees where it eats insects. It\nis attracted by\nlight at night.','medium',70,190,4),(50,49,'','The dustlike scales covering its wings\nare color-coded to indicate the kinds of\npoison it has.','medium',70,75,4),(51,50,'','  \n   \n .','medium',50,255,4),(52,51,'','A team of DIGLETT\ntriplets.\nIt triggers huge earthquakes by\nburrowing 60 miles\nunderground.','medium',50,50,4),(53,52,'','It washes its face regularly to keep the coin on\nits forehead spotless. It doesnt get along with\nGalarian Meowth.','medium',50,255,4),(54,53,'','Although its fur\nhas many admirers,\nit is tough to raise as a pet\nbecause of its\nfickle meanness.','medium',50,90,4),(55,54,'','While lulling its\nenemies with its\nvacant look, this wily POKMON will\nuse psychokinetic\npowers.','medium',50,190,4),(56,55,'','Often seen swim\nming elegantly by\nlake shores. It is often mistaken\nfor the Japanese\nmonster, Kappa.','medium',50,75,4),(57,56,'','Extremely quick to\nanger. It could\nbe docile one moment then\nthrashing away\nthe next instant.','medium',70,190,4),(58,57,'','Always furious\nand tenacious to\nboot. It will not abandon chasing\nits quarry until\nit is caught.','medium',70,75,4),(59,58,'','Very protective\nof its territory.\nIt will bark and bite to repel\nintruders from\nits space.','slow',50,190,2),(60,59,'','A POKMON that\nhas been admired\nsince the past for its beauty.\nIt runs agilely\nas if on wings.','slow',50,75,2),(61,60,'','Its newly grown\nlegs prevent it\nfrom running. It appears to prefer\nswimming than\ntrying to stand.','medium-slow',50,255,4),(62,61,'','Capable of living\nin or out of\nwater. When out of water, it\nsweats to keep\nits body slimy.','medium-slow',50,120,4),(63,62,'','An adept swimmer\nat both the front\ncrawl and breast stroke. Easily\novertakes the best\nhuman swimmers.','medium-slow',50,45,4),(64,63,'','Using its ability\nto read minds, it\nwill identify impending danger\nand TELEPORT to\nsafety.','medium-slow',50,200,2),(65,64,'','It emits special\nalpha waves from\nits body that induce headaches\njust by being\nclose by.','medium-slow',50,100,2),(66,65,'','Its brain can out\nperform a super\ncomputer. Its intelligence\nquotient is said\nto be 5,000.','medium-slow',50,50,2),(67,66,'','Malgr sa petite taille, sa force\nlui permet de soulever plusieurs\nRacaillou  la fois.','medium-slow',50,180,2),(68,67,'','Its muscular body\nis so powerful, it\nmust wear a power save belt to be\nable to regulate\nits motions.','medium-slow',50,90,2),(69,68,'','Using its heavy\nmuscles, it throws\npowerful punches that can send the\nvictim clear over\nthe horizon.','medium-slow',50,45,2),(70,69,'','A carnivorous\nPOKMON that traps\nand eats bugs. It uses its root\nfeet to soak up\nneeded moisture.','medium-slow',70,255,4),(71,70,'','It spits out\nPOISONPOWDER to\nimmobilize the enemy and then\nfinishes it with\na spray of ACID.','medium-slow',70,120,4),(72,71,'','Dieses Pokmon soll in groen Kolonien\ntief im Dschungel leben, doch niemand\nkann dies besttigen.','medium-slow',70,45,4),(73,72,'','Drifts in shallow\nseas. Anglers who\nhook them by accident are\noften punished by\nits stinging acid.','slow',50,190,4),(74,73,'','The tentacles are\nnormally kept\nshort. On hunts, they are extended\nto ensnare and\nimmobilize prey.','slow',50,60,4),(75,74,'','Found in fields\nand mountains.\nMistaking them for boulders,\npeople often step\nor trip on them.','medium-slow',70,255,4),(76,75,'','De naturaleza descuidada y libre, no le importa\ndaarse cuando baja rodando montaas.','medium-slow',70,120,4),(77,76,'','Its boulder-like\nbody is extremely\nhard. It can easily withstand\ndynamite blasts\nwithout damage.','medium-slow',70,45,4),(78,77,'','Its hooves are 10\ntimes harder than\ndiamonds. It can trample anything\ncompletely flat\nin little time.','medium',50,190,4),(79,78,'','Galopa a casi 240 km por hora. Su crin ardiente\nparece una flecha cuando corre.','medium',50,60,4),(80,79,'','Descansa ocioso junto al agua. Si algo muerde su\ncola, no lo notar en todo el da.','medium',50,190,4),(81,80,'','The SHELLDER that\nis latched onto\nSLOWPOKE\'s tail is said to feed\non the host\'s left\nover scraps.','medium',50,75,4),(82,81,'','Uses anti-gravity\nto stay suspended.\nAppears without warning and uses\nTHUNDER WAVE and\nsimilar moves.','medium',50,190,-1),(83,82,'','Formed by several\nMAGNEMITEs linked\ntogether. They frequently appear\nwhen sunspots\nflare up.','medium',50,60,-1),(84,83,'','The sprig of\ngreen onions it\nholds is its weapon. It is\nused much like a\nmetal sword.','medium',50,45,4),(85,84,'','A bird that makes\nup for its poor\nflying with its fast foot speed.\nLeaves giant\nfootprints.','medium',70,190,4),(86,85,'','\n60\n','medium',70,45,4),(87,86,'','The protruding\nhorn on its head\nis very hard. It is used for\nbashing through\nthick ice.','medium',70,190,4),(88,87,'','Stores thermal\nenergy in its\nbody. Swims at a steady 8 knots\neven in intensely\ncold waters.','medium',70,75,4),(89,88,'','Appears in filthy\nareas. Thrives by\nsucking up polluted sludge\nthat is pumped\nout of factories.','medium',70,190,4),(90,89,'','Thickly covered\nwith a filthy,\nvile sludge. It is so toxic, even\nits footprints\ncontain poison.','medium',70,75,4),(91,90,'','Its hard shell\nrepels any kind\nof attack. It is vulnerable\nonly when its\nshell is open.','slow',50,190,4),(92,91,'','When attacked, it\nlaunches its\nhorns in quick volleys. Its\ninnards have\nnever been seen.','slow',50,60,4),(93,92,'','Almost invisible,\nthis gaseous\nPOKMON cloaks the target and\nputs it to sleep\nwithout notice.','medium-slow',50,190,4),(94,93,'','Because of its\nability to slip\nthrough block walls, it is said\nto be from an\nother dimension.','medium-slow',50,90,4),(95,94,'','Under a full moon,\nthis POKMON\nlikes to mimic the shadows of\npeople and laugh\nat their fright.','medium-slow',50,45,4),(96,95,'','As it grows, the\nstone portions of\nits body harden to become similar\nto a diamond, but\ncolored black.','medium',50,45,4),(97,96,'','Puts enemies to\nsleep then eats\ntheir dreams. Occasionally gets\nsick from eating\nbad dreams.','medium',70,190,4),(98,97,'','When it locks eyes\nwith an enemy, it\nwill use a mix of PSI moves such as\nHYPNOSIS and\nCONFUSION.','medium',70,75,4),(99,98,'','Its pincers are\nnot only powerful\nweapons, they are used for balance\nwhen walking\nsideways.','medium',50,225,4),(100,99,'','The large pincer\nhas 10000 hp of\ncrushing power. However, its huge\nsize makes it\nunwieldy to use.','medium',50,60,4),(101,100,'','Usually found in\npower plants.\nEasily mistaken for a POK BALL,\nthey have zapped\nmany people.','medium',70,190,-1),(102,101,'','It stores electric\nenergy under very\nhigh pressure. It often explodes\nwith little or no\nprovocation.','medium',70,60,-1),(103,102,'','Often mistaken\nfor eggs.\nWhen disturbed, they quickly\ngather and attack\nin swarms.','slow',50,90,4),(104,103,'','Legend has it that\non rare occasions,\none of its heads will drop off and\ncontinue on as an\nEXEGGCUTE.','slow',50,45,4),(105,104,'','Because it never\nremoves its skull\nhelmet, no one has ever seen\nthis POKMON\'s\nreal face.','medium',50,190,4),(106,105,'','\n','medium',50,75,4),(107,106,'','When in a hurry,\nits legs lengthen\nprogressively. It runs smoothly\nwith extra long,\nloping strides.','medium',50,45,0),(108,107,'','While apparently\ndoing nothing, it\nfires punches in lightning fast\nvolleys that are\nimpossible to see.','medium',50,45,0),(109,108,'','Its tongue can be\nextended like a\nchameleon\'s. It leaves a tingling\nsensation when it\nlicks enemies.','medium',50,45,4),(110,109,'','Because it stores\nseveral kinds of\ntoxic gases in its body, it is\nprone to exploding\nwithout warning.','medium',50,190,4),(111,110,'','Where two kinds\nof poison gases\nmeet, 2 KOFFINGs can fuse into a\nWEEZING over many\nyears.','medium',50,60,4),(112,111,'','A POKMON with a\none-track mind.\nOnce it charges,  it won\'t stop\nrunning until it\nfalls asleep.','slow',50,120,4),(113,112,'','Protected by an\narmor-like hide,\nit is capable of living in molten\nlava of 3,600\ndegrees.','slow',50,60,4),(114,113,'','A rare and elusive\nPOKMON that is\nsaid to bring happiness to those\nwho manage to get\nit.','fast',140,30,8),(115,114,'','The whole body is\nswathed with wide\nvines that are similar to sea\nweed. Its vines\nshake as it walks.','medium',50,45,4),(116,115,'','The infant rarely\nventures out of\nits mother\'s protective pouch\nuntil it is 3\nyears old.','medium',50,45,8),(117,116,'','Known to shoot\ndown flying bugs\nwith precision blasts of ink\nfrom the surface\nof the water.','medium',50,225,4),(118,117,'','Capable of swim\nming backwards by\nrapidly flapping its wing-like\npectoral fins and\nstout tail.','medium',50,75,4),(119,118,'','Its tail fin\nbillows like an\nelegant ballroom dress, giving it\nthe nickname of\nthe Water Queen.','medium',50,225,4),(120,119,'','In the autumn spawning season, they can\nbe seen swimming powerfully up rivers and\ncreeks.','medium',50,60,4),(121,120,'','If its body is torn, it can grow\nback if the red core remains.\nThe core flashes at midnight.','slow',50,225,-1),(122,121,'','Its central core\nglows with the\nseven colors of the rainbow. Some\npeople value the\ncore as a gem.','slow',50,60,-1),(123,122,'','If interrupted\nwhile it is\nmiming, it will slap around the\noffender with its\nbroad hands.','medium',50,45,4),(124,123,'','With ninja-like\nagility and speed,\nit can create the illusion that\nthere is more\nthan one.','medium',50,45,4),(125,124,'','It seductively\nwiggles its hips\nas it walks. It can cause people\nto dance in\nunison with it.','medium',50,45,8),(126,125,'','Normally found\nnear power plants,\nthey can wander away and cause\nmajor blackouts\nin cities.','medium',50,45,2),(127,126,'','Its body always\nburns with an\norange glow that enables it to\nhide perfectly\namong flames.','medium',50,45,2),(128,127,'','If it fails to\ncrush the victim\nin its pincers, it will swing it\naround and toss\nit hard.','slow',50,45,4),(129,128,'','When it targets\nan enemy, it\ncharges furiously while whipping its\nbody with its\nlong tails.','slow',50,45,0),(130,129,'','In the distant\npast, it was\nsomewhat stronger than the horribly\nweak descendants\nthat exist today.','slow',50,255,4),(131,130,'','Once it begins to rampage, a\nGYARADOS will burn everything\ndown, even in a harsh storm.','slow',50,45,4),(132,131,'','A POKMON that\nhas been over\nhunted almost to extinction. It\ncan ferry people\nacross the water.','slow',50,45,4),(133,132,'','Capable of copying\nan enemy\'s genetic\ncode to instantly transform itself\ninto a duplicate\nof the enemy.','medium',50,35,-1),(134,133,'','Its genetic code\nis irregular.\nIt may mutate if it is exposed to\nradiation from\nelement STONEs.','medium',50,45,1),(135,134,'','Lives close to\nwater. Its long\ntail is ridged with a fin which\nis often mistaken\nfor a mermaid\'s.','medium',50,45,1),(136,135,'','It accumulates\nnegative ions in\nthe atmosphere to blast out 10000-\nvolt lightning\nbolts.','medium',50,45,1),(137,136,'','When storing\nthermal energy in\nits body, its temperature could\nsoar to over 1600\ndegrees.','medium',50,45,1),(138,137,'','A POKMON that\nconsists entirely\nof programming code. Capable of\nmoving freely in\ncyberspace.','medium',50,45,-1),(139,138,'','Although long\nextinct, in rare\ncases, it can be genetically\nresurrected from\nfossils.','medium',50,45,1),(140,139,'','A prehistoric\nPOKMON that died\nout when its heavy shell made\nit impossible to\ncatch prey.','medium',50,45,1),(141,140,'','A POKMON that\nwas resurrected\nfrom a fossil found in what was\nonce the ocean\nfloor eons ago.','medium',50,45,1),(142,141,'',' un perfetto nuotatore. Taglia la preda\ncon le sue falci e ne succhia il sangue.','medium',50,45,1),(143,142,'','A Pokmon that roamed the skies\nin the dinosaur era. Its teeth are\nlike saw blades.','slow',50,45,1),(144,143,'','Very lazy. Just\neats and sleeps.\nAs its rotund bulk builds, it\nbecomes steadily\nmore slothful.','slow',50,25,1),(145,144,'','A legendary bird\nPOKMON that is\nsaid to appear to doomed people who\nare lost in icy\nmountains.','slow',35,3,-1),(146,145,'','\n\n','slow',35,3,-1),(147,146,'','Known as the\nlegendary bird of\nfire. Every flap of its wings\ncreates a dazzling\nflash of flames.','slow',35,3,-1),(148,147,'','Long considered a\nmythical POKMON\nuntil recently when a small\ncolony was found\nliving underwater.','slow',35,45,4),(149,148,'','\n\n','slow',35,45,4),(150,149,'','An extremely\nrarely seen\nmarine POKMON. Its intelligence\nis said to match\nthat of humans.','slow',35,45,4),(151,150,'','It was created by\na scientist after\nyears of horrific gene splicing and\nDNA engineering\nexperiments.','slow',0,3,-1),(152,151,'','So rare that it\nis still said to\nbe a mirage by many experts. Only\na few people have\nseen it worldwide.','medium-slow',100,45,-1),(153,152,'','A sweet aroma\ngently wafts from\nthe leaf on its head. It is docile\nand loves to soak\nup the sun\'s rays.','medium-slow',70,45,1),(154,153,'','The scent of\nspices comes from\naround its neck. Somehow, sniffing\nit makes you want\nto fight.','medium-slow',70,45,1),(155,154,'','The aroma that\nrises from its\npetals contains a substance that\ncalms aggressive\nfeelings.','medium-slow',70,45,1),(156,155,'','It has a timid nature. If it is startled, the flames on\nits back burn more vigorously.','medium-slow',70,45,1),(157,156,'','Be careful if it\nturns its back\nduring battle. It means that it will\nattack with the\nfire on its back.','medium-slow',70,45,1),(158,157,'','If its rage peaks,\nit becomes so hot\nthat anything that touches it will\ninstantly go\nup in flames.','medium-slow',70,45,1),(159,158,'','Its well-developed\njaws are powerful\nand capable of crushing anything.\nEven its trainer\nmust be careful.','medium-slow',70,45,1),(160,159,'','If it loses a\nfang, a new one\ngrows back in its place. There are\nalways 48 fangs\nlining its mouth.','medium-slow',70,45,1),(161,160,'','When it bites with\nits massive and\npowerful jaws, it shakes its head\nand savagely tears\nits victim up.','medium-slow',70,45,1),(162,161,'','A very cautious\nPOKMON, it raises\nitself up using its tail to get a\nbetter view of its\nsurroundings.','medium',70,255,4),(163,162,'','It makes a nest to\nsuit its long and\nskinny body. The nest is impossible\nfor other POKMON\nto enter.','medium',70,90,4),(164,163,'','It always stands\non one foot. It\nchanges feet so fast, the movement\ncan rarely be\nseen.','medium',50,255,4),(165,164,'','Its eyes are\nspecially adapted.\nThey concentrate even faint light\nand enable it to\nsee in the dark.','medium',50,90,4),(166,165,'','It is very timid.\nIt will be afraid\nto move if it is alone. But it will\nbe active if it is\nin a group.','fast',70,255,4),(167,166,'','When the stars\nflicker in the\nnight sky, it flutters about,\nscattering a\nglowing powder.','fast',70,90,4),(168,167,'','It lies still in\nthe same pose for\ndays in its web, waiting for its\nunsuspecting prey\nto wander close.','fast',70,255,4),(169,168,'','\n\n','fast',70,90,4),(170,169,'','It flies so si\nlently through the\ndark on its four wings that it may\nnot be noticed\neven when nearby.','medium',50,90,4),(171,170,'','Chinchou blink their shining antennae at one\nanother to claim their respective turf.','slow',50,190,4),(172,171,'','The light it emits\nis so bright that\nit can illuminate the sea\'s surface\nfrom a depth of\nover three miles.','slow',50,75,4),(173,172,'','It is not yet\nskilled at storing\nelectricity. It may send out a\njolt if amused\nor startled.','medium',50,190,4),(174,173,'','Because of its\nunusual, star-like\nsilhouette, people believe that it\ncame here on\na meteor.','fast',140,150,6),(175,174,'','It has a very soft\nbody. If it starts\nto roll, it will bounce all over\nand be impossible\nto stop.','fast',50,170,6),(176,175,'','The shell seems to\nbe filled with\njoy. It is said that it will share\ngood luck when\ntreated kindly.','fast',50,190,1),(177,176,'','They say that it\nwill appear before\nkindhearted, car ing people and\nshower them with\nhappiness.','fast',50,75,1),(178,177,'','Because its wings\naren\'t yet fully\ngrown, it has to hop to get around.\nIt is always star\ning at something.','medium',50,190,4),(179,178,'','They say that it\nstays still and\nquiet because it is seeing both the\npast and future at\nthe same time.','medium',50,75,4),(180,179,'','If static elec\ntricity builds in\nits body, its fleece doubles in\nvolume. Touching\nit will shock you.','medium-slow',70,235,4),(181,180,'','  \n    \n   .','medium-slow',70,120,4),(182,181,'','The tail\'s tip\nshines brightly\nand can be seen from far away. It\nacts as a beacon\nfor lost people.','medium-slow',70,45,4),(183,182,'','Plentiful in the tropics. When it\ndances, its petals rub together and\nmake a pleasant ringing sound.','medium-slow',50,45,4),(184,183,'','The tip of its\ntail, which con\ntains oil that is lighter than wa\nter, lets it swim\nwithout drowning.','fast',50,190,4),(185,184,'','It lives in water virtually all day long.\nIts body color and pattern act as\ncamouflage that makes it tough for\nenemies to spot in water.','fast',50,75,4),(186,185,'','Although it always\npretends to be a\ntree, its composi tion appears to be\ncloser to a rock\nthan a plant.','medium',50,65,4),(187,186,'','If POLIWAG and\nPOLIWHIRL hear its\nechoing cry, they respond by gather\ning from far and\nwide.','medium-slow',50,45,4),(188,187,'','To keep from being\nblown away by the\nwind, they gather in clusters. They\ndo enjoy gentle\nbreezes, though.','medium-slow',70,255,4),(189,188,'','The bloom on top\nof its head opens\nand closes as the temperature fluc\ntuates up and\ndown.','medium-slow',70,120,4),(190,189,'','Once it catches\nthe wind, it deft\nly controls its cotton-puff spores\nto float, even\naround the world.','medium-slow',70,45,4),(191,190,'','Sa queue est aussi agile que ses\nmains. Il vit en haut des grands\narbres.','fast',70,45,4),(192,191,'','It may drop out of\nthe sky suddenly.\nIf attacked by a SPEAROW, it will\nviolently shake\nits leaves.','medium-slow',70,235,4),(193,192,'','It converts sun\nlight into energy.\nIn the darkness after sunset, it\ncloses its petals\nand becomes still.','medium-slow',70,120,4),(194,193,'','If it flaps its\nwings really fast,\nit can generate shock waves that\nwill shatter win\ndows in the area.','medium',70,75,4),(195,194,'','This POKMON lives\nin cold water. It\nwill leave the water to search\nfor food when it\ngets cold outside.','medium',50,255,4),(196,195,'','This carefree\nPOKMON has an\neasy-going nature. While swimming, it\nalways bumps into\nboat hulls.','medium',50,90,4),(197,196,'','It uses the fine\nhair that covers\nits body to sense air currents and\npredict its ene\nmy\'s actions.','medium',50,45,1),(198,197,'','When agitated,\nthis POKMON pro\ntects itself by spraying poisonous\nsweat from its\npores.','medium',35,45,1),(199,198,'','Feared and loathed\nby many, it is\nbelieved to bring misfortune to all\nthose who see it\nat night.','medium-slow',35,30,4),(200,199,'','It has incredible\nintellect and in\ntuition. Whatever the situation, it\nremains calm and\ncollected.','medium',50,70,4),(201,200,'','It likes playing\nmischievous tricks\nsuch as screaming and wailing to\nstartle people at\nnight.','fast',35,45,4),(202,201,'','Their shapes look\nlike hieroglyphs\non ancient tab lets. It is said\nthat the two are\nsomehow related.','medium',70,225,-1),(203,202,'','Odia la luz y las sacudidas. Si le atacan, infla su\ncuerpo para aumentar su contraataque.','medium',50,45,4),(204,203,'','Its tail has a\nsmall brain of its\nown. Beware! If you get close, it\nmay react to your\nscent and bite.','medium',70,60,4),(205,204,'','It likes to make\nits shell thicker\nby adding layers of tree bark. The\nadditional weight\ndoesn\'t bother it.','medium',70,190,4),(206,205,'','Its entire body is\nshielded by a\nsteel-hard shell. What lurks inside\nthe armor is a\ntotal mystery.','medium',70,75,4),(207,206,'','When spotted, this\nPOKMON escapes\nbackward by furi ously boring into\nthe ground with\nits tail.','medium',50,190,4),(208,207,'','It flies straight\nat its target\'s\nface then clamps down on the star\ntled victim to\ninject poison.','medium-slow',70,60,4),(209,208,'','It is thought its body transformed\nas a result of iron accumulating\ninternally from swallowing soil.','medium',50,25,4),(210,209,'','Although it looks\nfrightening, it is\nactually kind and affectionate. It\nis very popular\namong women.','fast',70,190,6),(211,210,'','It is actually\ntimid and easily\nspooked. If at tacked, it flails\nabout to fend off\nits attacker.','fast',70,75,6),(212,211,'','To fire its poison\nspikes, it must\ninflate its body by drinking over\n2.6 gallons of\nwater all at once.','medium',50,45,4),(213,212,'','It has a steel-hard body. It\nintimidates foes by upraising its\neye-patterned pincers.','medium',50,25,4),(214,213,'','The BERRIES it\nstores in its\nvase-like shell decompose and\nbecome a gooey\nliquid.','medium-slow',50,190,4),(215,214,'','It is usually docile, but if it is\ndisturbed while sipping honey,\nit chases off the intruder with its horn.','slow',50,45,4),(216,215,'','\n\n','medium-slow',35,60,4),(217,216,'','If it finds honey,\nits crescent mark\nglows. It always licks its paws\nbecause they are\nsoaked with honey.','medium',70,120,4),(218,217,'','Although it is a\ngood climber, it\nprefers to snap trees with its\nforelegs and eat\nfallen BERRIES.','medium',70,60,4),(219,218,'','Asiduo a las zonas volcnicas, se desliza lentamente\nen busca de lugares calientes.','medium',70,190,4),(220,219,'','The shell on its\nback is just skin\nthat has cooled and hardened. It\nbreaks easily with\na slight touch.','medium',70,75,4),(221,220,'','It rubs its snout\non the ground to\nfind and dig up food. It sometimes\ndiscovers hot\nsprings.','slow',50,225,4),(222,221,'','Because the long\nhair all over its\nbody obscures its sight, it just\nkeeps charging\nrepeatedly.','slow',50,75,4),(223,222,'','It continuously\nsheds and grows.\nThe tip of its head is prized as\na treasure for its\nbeauty.','fast',50,60,6),(224,223,'','It has superb ac\ncuracy. The water\nit shoots out can strike even moving\nprey from more\nthan 300 feet.','medium',50,190,4),(225,224,'','It traps enemies\nwith its suction-\ncupped tentacles then smashes them\nwith its rock-hard\nhead.','medium',50,75,4),(226,225,'','It carries food\nall day long.\nThere are tales about lost people\nwho were saved by\nthe food it had.','fast',50,45,4),(227,226,'','As it majestically\nswims, it doesn\'t\ncare if REMORAID attach to it for\nscavenging its\nleftovers.','slow',50,25,4),(228,227,'','Its sturdy wings\nlook heavy, but\nthey are actually hollow and light,\nallowing it to fly\nfreely in the sky.','slow',50,25,4),(229,228,'','It uses different\nkinds of cries for\ncommunicating with others of its kind\nand for pursuing\nits prey.','slow',35,120,4),(230,229,'','If you are burned\nby the flames it\nshoots from its mouth, the pain\nwill never go\naway.','slow',35,45,4),(231,230,'','It is said that it\nusually hides in\nunderwater caves. It can create\nwhirlpools by\nyawning.','medium',50,45,4),(232,231,'','It swings its long\nsnout around play\nfully, but because it is so strong,\nthat can be dan\ngerous.','medium',70,120,4),(233,232,'','It has sharp, hard\ntusks and a rugged\nhide. Its TACKLE is strong enough\nto knock down a\nhouse.','medium',70,60,4),(234,233,'','This upgraded\nversion of PORYGON\nis designed for space exploration.\nIt can\'t fly,\nthough.','medium',50,45,-1),(235,234,'','The curved antlers\nsubtly change the\nflow of air to create a strange\nspace where real\nity is distorted.','slow',70,45,4),(236,235,'','A special fluid\noozes from the tip\nof its tail. It paints the fluid\neverywhere to mark\nits territory.','fast',70,45,4),(237,236,'','It is always\nbursting with en\nergy. To make it self stronger, it\nkeeps on fighting\neven if it loses.','medium',50,75,0),(238,237,'','If you become\nenchanted by its\nsmooth, elegant, dance-like kicks,\nyou may get\ndrilled hard.','medium',50,45,0),(239,238,'','Its lips are the\nmost sensitive\nparts on its body. It always uses its\nlips first to\nexamine things.','medium',50,45,8),(240,239,'','\n\n','medium',50,45,2),(241,240,'','Each and every\ntime it inhales\nand exhales, hot embers dribble out\nof its mouth and\nnostrils.','medium',50,45,2),(242,241,'','Si tiene cras, la leche que produce contiene muchos\nms nutrientes de lo normal.','slow',50,45,8),(243,242,'','Anyone who takes\neven one bite of\nBLISSEY\'s egg be comes unfailingly\ncaring and pleas\nant to everyone.','fast',140,30,8),(244,243,'','The rain clouds it\ncarries let it\nfire thunderbolts at will. They say\nthat it descended\nwith lightning.','slow',35,3,-1),(245,244,'','Volcanoes erupt\nwhen it barks. Un\nable to restrain its extreme power,\nit races headlong\naround the land.','slow',35,3,-1),(246,245,'','It races around the world to\npurify fouled water. It dashes\naway with the north wind.','slow',35,3,-1),(247,246,'','It feeds on soil.\nAfter it has eaten\na large mountain, it will fall\nasleep so it can\ngrow.','slow',35,45,4),(248,247,'','Its shell is as\nhard as sheet\nrock, and it is also very strong.\nIts THRASHING can\ntopple a mountain.','slow',35,45,4),(249,248,'','Its body can\'t be\nharmed by any sort\nof attack, so it is very eager to\nmake challenges\nagainst enemies.','slow',35,45,4),(250,249,'','It is said that it\nquietly spends its\ntime deep at the bottom of the sea\nbecause its powers\nare too strong.','slow',0,3,-1),(251,250,'','Legends claim this\nPOKMON flies the\nworld\'s skies con tinuously on its\nmagnificent seven-\ncolored wings.','slow',0,3,-1),(252,251,'','This POKMON wan\nders across time.\nGrass and trees flourish in the\nforests in which\nit has appeared.','medium-slow',100,45,-1),(253,252,'','TREECKO has small hooks on the bottom\nof its feet that enable it to scale\nvertical walls. This POKMON attacks by slamming foes\nwith its thick tail.','medium-slow',50,45,1),(254,253,'','  \n \n  .','medium-slow',50,45,1),(255,254,'','The leaves growing on SCEPTILEs body\nare very sharp edged. This POKMON is\nvery agile - it leaps all over the branches of trees and jumps on its foe\nfrom above or behind.','medium-slow',50,45,1),(256,255,'','TORCHIC sticks with its TRAINER,\nfollowing behind with unsteady\nsteps. This POKMON breathes fire of over\n1,800 degrees F, including fireballs\nthat leave the foe scorched black.','medium-slow',50,45,1),(257,256,'','COMBUSKEN toughens up its legs and\nthighs by running through fields and\nmountains. This POKMONs legs possess both speed\nand power, enabling it to dole out ten\nkicks in one second.','medium-slow',50,45,1),(258,257,'','In battle, BLAZIKEN blows out intense\nflames from its wrists and attacks foes\ncourageously. The stronger the foe, the more\nintensely this POKMONs wrists burn.','medium-slow',50,45,1),(259,258,'','The fin on MUDKIPs head acts as highly\nsensitive radar. Using this fin to sense\nmovements of water and air, this POKMON can determine what is taking\nplace around it without using its eyes.','medium-slow',50,45,1),(260,259,'','The surface of MARSHTOMPs body is\nenveloped by a thin, sticky film that\nenables it to live on land. This POKMON plays in mud on beaches\nwhen the ocean tide is low.','medium-slow',50,45,1),(261,260,'','SWAMPERT is very strong. It has enough\npower to easily drag a boulder weighing\nmore than a ton. This POKMON also has powerful vision\nthat lets it see even in murky water.','medium-slow',50,45,1),(262,261,'','At first sight, POOCHYENA takes a bite\nat anything that moves.\nThis POKMON chases after prey until the victim becomes exhausted.\nHowever, it may turn tail if the prey\nstrikes back.','medium',70,255,4),(263,262,'','Les Grahyna forment des meutes de dix qui\nexcellent au travail de groupe pour capturer leurs\nproies.','medium',70,127,4),(264,263,'','ZIGZAGOON restlessly wanders\neverywhere at all times. This POKMON\ndoes so because it is very curious. It becomes interested in anything\nthat it happens to see.','medium',50,255,4),(265,264,'','LINOONE always runs full speed and only\nin straight lines. If facing an obstacle,\nit makes a right-angle turn to evade it. This POKMON is very challenged by\ngently curving roads.','medium',50,90,4),(266,265,'','Le encanta comer hojas. Si le ataca un Starly, se\ndefender con sus pas.','medium',70,255,4),(267,266,'','SILCOON tethers itself to a tree branch\nusing silk to keep from falling. There, \nthis POKMON hangs quietly while it awaits evolution.\nIt peers out of the silk cocoon through\na small hole.','medium',70,120,4),(268,267,'','BEAUTIFLYs favorite food is the sweet\npollen of flowers. If you want to see\nthis POKMON, just leave a potted flower by an open window. BEAUTIFLY\nis sure to come looking for pollen.','medium',70,45,4),(269,268,'','CASCOON makes its protective cocoon\nby wrapping its body entirely with a\nfine silk from its mouth. Once the silk goes around its body, it hardens.\nThis POKMON prepares for its evolution\ninside the cocoon.','medium',70,120,4),(270,269,'','DUSTOX is instinctively drawn to light.\nSwarms of this POKMON are attracted\nby the bright lights of cities, where they wreak havoc by stripping the\nleaves off roadside trees for food.','medium',70,45,4),(271,270,'','It searches about for clean water. If it does not\ndrink water for too long, the leaf on its head wilts.','medium-slow',50,255,4),(272,271,'','It lives at the waters edge where it is\nsunny. It sleeps on a bed of water grass\nby day and becomes active at night.','medium-slow',50,120,4),(273,272,'','LUDICOLO begins dancing as soon as\nit hears cheerful, festive music.\nThis POKMON is said to appear when it hears the singing of children on hiking\noutings.','medium-slow',50,45,4),(274,273,'','SEEDOT attaches itself to a tree\nbranch using the top of its head.\nIt sucks moisture from the tree while hanging off the branch.\nThe more water it drinks, the glossier\nthis POKMONs body becomes.','medium-slow',50,255,4),(275,274,'','NUZLEAF live in densely overgrown\nforests. They occasionally venture out\nof the forest to startle people. This POKMON dislikes having its long\nnose pinched.','medium-slow',50,120,4),(276,275,'','It lives quietly in the deep forest.\nIt is said to create chilly winter\nwinds with the fans it holds.','medium-slow',50,45,4),(277,276,'','TAILLOW courageously stands its\nground against foes, however strong\nthey may be. This gutsy POKMON will remain defiant\neven after a loss. On the other hand,\nit cries loudly if it becomes hungry.','medium-slow',70,200,4),(278,277,'','SWELLOW flies high above our heads,\nmaking graceful arcs in the sky.\nThis POKMON dives at a steep angle as soon as it spots its prey. The hapless\nprey is tightly grasped by SWELLOWs\nclawed feet, preventing escape.','medium-slow',70,45,4),(279,278,'','WINGULL has the habit of carrying prey\nand valuables in its beak and hiding\nthem in all sorts of locations. This POKMON rides the winds and flies\nas if it were skating across the sky.','medium',50,190,4),(280,279,'','It is a messenger of the skies,\ncarrying small Pokmon and\neggs to safety in its bill.','medium',50,45,4),(281,280,'','RALTS senses the emotions of\npeople using the horns on its head.\nThis POKMON rarely appears before people. But when it does, it draws\ncloser if it senses that the person has\na positive disposition.','slow',35,235,4),(282,281,'','It is said that a KIRLIA that is\nexposed to the positive emotions of\nits TRAINER grows beautiful. This POKMON controls psychokinetic\npowers with its highly developed brain.','slow',35,120,4),(283,282,'','GARDEVOIR has the ability to read the\nfuture. If it senses impending danger\nto its TRAINER, this POKMON is said to unleash its psychokinetic energy at\nfull power.','slow',35,45,4),(284,283,'','\n\n','medium',70,200,4),(285,284,'','MASQUERAIN intimidates enemies with\nthe eyelike patterns on its antennas.\nThis POKMON flaps its four wings to freely fly in any direction - even\nsideways and backwards - as if it were\na helicopter.','medium',70,75,4),(286,285,'','SHROOMISH live in damp soil in the dark\ndepths of forests. They are often\nfound keeping still under fallen leaves. This POKMON feeds on compost that\nis made up of fallen, rotted leaves.','fast-then-very-slow',70,255,4),(287,286,'','Erst lsst es den Gegner seine giftigen Sporen\neinatmen, dann traktiert es ihn mit Boxschlgen.','fast-then-very-slow',70,90,4),(288,287,'','SLAKOTH lolls around for over twenty\nhours every day. Because it moves so\nlittle, it does not need much food. This POKMONs sole daily meal consists\nof just three leaves.','slow',70,255,4),(289,288,'','VIGOROTH is always itching and agitated\nto go on a wild rampage. It simply cant\ntolerate sitting still for even a minute. This POKMONs stress level rises if it\ncant be moving constantly.','slow',70,120,4),(290,289,'','SLAKING spends all day lying down and\nlolling about.\nIt eats grass growing within its reach. If it eats all the grass it can reach,\nthis POKMON reluctantly moves to\nanother spot.','slow',70,45,4),(291,290,'','NINCADA lives underground for many\nyears in complete darkness.\nThis POKMON absorbs nutrients from the roots of trees. It stays motionless\nas it waits for evolution.','slow-then-very-fast',50,255,4),(292,291,'','NINJASK moves around at such a high\nspeed that it cannot be seen, even\nwhile its crying can be clearly heard. For that reason, this POKMON was long\nbelieved to be invisible.','slow-then-very-fast',50,120,4),(293,292,'','SHEDINJAs hard body doesnt move -\nnot even a twitch. In fact, its body\nappears to be merely a hollow shell. It is believed that this POKMON will\nsteal the 