s deep inside\ncaverns. They are feared, however,\nbecause these POKMON are thought to steal the spirits of people when their\neyes burn with a sinister glow in the\ndarkness.','medium-slow',35,45,4),(304,303,'','MAWHILEs huge jaws are actually steel\nhorns that have been transformed.\nIts docile-looking face serves to lull its foe into letting down its guard.\nWhen the foe least expects it, MAWHILE\nchomps it with its gaping jaws.','fast',50,45,4),(305,304,'','This POKMON has a body of steel.\nTo make its body, ARON feeds on\niron ore that it digs from mountains. Occasionally, it causes major trouble by\neating bridges and rails.','slow',35,180,4),(306,305,'','LAIRON tempers its steel body by\ndrinking highly nutritious mineral\nspringwater until it is bloated. This POKMON makes its nest close to\nsprings of delicious water.','slow',35,90,4),(307,306,'','AGGRON claims an entire mountain as its\nown territory. It mercilessly beats up\nanything that violates its environment. This POKMON vigilantly patrols its\nterritory at all times.','slow',35,45,4),(308,307,'','\n\n','medium',70,180,4),(309,308,'','It is said that through meditation,\nMEDICHAM heightens energy inside\nits body and sharpens its sixth sense. This POKMON hides its presence by\nmerging itself with fields and\nmountains.','medium',70,90,4),(310,309,'','ELECTRIKE stores electricity in its\nlong body hair. This POKMON stimulates\nits leg muscles with electric charges. These jolts of power give its legs\nexplosive acceleration performance.','slow',50,120,4),(311,310,'','MANECTRIC is constantly discharging\nelectricity from its mane. The sparks\nsometimes ignite forest fires. When it enters a battle, this POKMON\ncreates thunderclouds.','slow',50,45,4),(312,311,'','PLUSLE always acts as a cheerleader\nfor its partners. Whenever a teammate\nputs out a good effort in battle, this POKMON shorts out its body to create\nthe crackling noises of sparks to show\nits joy.','medium',70,200,4),(313,312,'','MINUN is more concerned about cheering\non its partners than its own safety.\nIt shorts out the electricity in its body to create brilliant showers of\nsparks to cheer on its teammates.','medium',70,200,4),(314,313,'','With the arrival of night, VOLBEAT emits\nlight from its tail. It communicates with\nothers by adjusting the intensity and flashing of its light.\nThis POKMON is attracted by the sweet\naroma of ILLUMISE.','slow-then-very-fast',70,150,0),(315,314,'','With its sweet aroma, it guides\nVolbeat to draw signs with light in\nthe night sky.','fast-then-very-slow',70,150,8),(316,315,'','ROSELIA shoots sharp thorns as\nprojectiles at any opponent that tries\nto steal the flowers on its arms. The aroma of this POKMON brings\nserenity to living things.','medium-slow',50,150,4),(317,316,'','Virtually all of GULPINs body is its\nstomach. As a result, it can swallow\nsomething its own size. This POKMONs stomach contains a\nspecial fluid that digests anything.','fast-then-very-slow',70,225,4),(318,317,'','Es verschluckt, was in sein Maul passt, und verdaut es\nmit seiner alles zersetzenden Magensure.','fast-then-very-slow',70,75,4),(319,318,'','CARVANHAs strongly developed jaws\nand its sharply pointed fangs pack the\ndestructive power to rip out boat hulls. Many boats have been attacked and\nsunk by this POKMON.','slow',35,225,4),(320,319,'','Nicknamed the bully of the sea,\nSHARPEDO is widely feared.\nIts cruel fangs grow back immediately if they snap off.\nJust one of these POKMON can\nthoroughly tear apart a supertanker.','slow',35,60,4),(321,320,'','WAILMERs nostrils are located above\nits eyes. This playful POKMON loves\nto startle people by forcefully snorting out seawater it stores inside its body\nout of its nostrils.','fast-then-very-slow',50,125,4),(322,321,'','WAILORD is the largest of all identified\nPOKMON up to now.\nThis giant POKMON swims languorously in the vast open sea, eating massive\namounts of food at once with its\nenormous mouth.','fast-then-very-slow'