e like cottony clouds. This POKMON\nis not frightened of people. It lands on the heads of people and\nsits there like a cotton-fluff hat.','slow-then-very-fast',50,255,4),(335,334,'','Il vole librement en se cachant dans les nuages.\nSon chant est digne de celui de la plus doue des\nsopranos.','slow-then-very-fast',50,45,4),(336,335,'','Memories of battling its arch-rival\nSEVIPER are etched into every cell of\nZANGOOSEs body. This POKMON adroitly dodges attacks\nwith incredible agility.','slow-then-very-fast',70,90,4),(337,336,'','SEVIPER shares a generations-long\nfeud with ZANGOOSE. The scars on its\nbody are evidence of vicious battles. This POKMON attacks using its sword-\nedged tail.','fast-then-very-slow',70,90,4),(338,337,'','LUNATONE was discovered at a location\nwhere a meteorite fell. As a result, some\npeople theorize that this POKMON came from space. However, no one has\nbeen able to prove this theory so far.','fast',50,45,-1),(339,338,'','Solar energy is the source of its power,\nso it is strong during the daytime.\nWhen it spins, its body shines.','fast',50,45,-1),(340,339,'','BARBOACHs sensitive whiskers serve\nas a superb radar system.\nThis POKMON hides in mud, leaving only its two whiskers exposed while it waits\nfor prey to come along.','medium',50,190,4),(341,340,'','WHISCASH is extremely territorial.\nJust one of these POKMON will claim a\nlarge pond as its exclusive territory. If a foe approaches it, it thrashes\nabout and triggers a massive\nearthquake.','medium',50,75,4),(342,341,'','Its hardy vitality enables it to\nadapt to any environment. Its\npincers will never release prey.','fast-then-very-slow',50,205,4),(343,342,'','CRAWDAUNT has an extremely violent\nnature that compels it to challenge\nother living things to battle. Other life-forms refuse to live in\nponds inhabited by this POKMON,\nmaking them desolate places.','fast-then-very-slow',50,155,4),(344,343,'','BALTOY moves while spinning around on\nits one foot. Primitive wall paintings\ndepicting this POKMON living among people were discovered in some ancient\nruins.','medium',50,255,-1),(345,344,'','CLAYDOL are said to be dolls of mud made\nby primitive humans and brought to life\nby exposure to a mysterious ray. This POKMON moves about while\nlevitating.','medium',50,90,-1),(346,345,'','LILEEP became extinct approximately\na hundred million years ago.\nThis ancient POKMON attaches itself to a rock on the seafloor and catches\napproaching prey using tentacles \nshaped like flower petals.','slow-then-very-fast',50,45,1),(347,346,'','CRADILY roams around the ocean floor\nin search of food. This POKMON freely\nextends its tree trunk-like neck and captures unwary prey using its eight\ntentacles.','slow-then-very-fast',50,45,1),(348,347,'','ANORITH was regenerated from a\nprehistoric fossil. This primitive\nPOKMON once lived in warm seas. It grips its prey firmly between its\ntwo large claws.','slow-then-very-fast',50,45,1),(349,348,'','ARMALDOs tough armor makes all attacks\nbounce off. This POKMONs two\nenormous claws can be freely extended or contracted. They have the power to\npunch right through a steel slab.','slow-then-very-fast',50,45,1),(350,349,'','FEEBASs fins are ragged and\ntattered from the start of its life.\nBecause of its shoddy appearance, this POKMON is largely ignored.\nIt is capable of living in both the sea\nand in rivers.','slow-then-very-fast',50,255,4),(351,350,'','Ses splendides cailles aux couleurs\nde larc-en-ciel changent de teinte\nselon langle de vue.','slow-then-very-fast',50,60,4),(352,351,'','CASTFORMs appearance changes with\nthe weather.\nThis POKMON gained the ability to use the vast power of nature to protect\nits tiny body.','medium',70,45,4),(353,352,'','It changes body color to blend in with\nits surroundings. It also changes color if\nit is happy or sad.','medium-slow',70,200,4),(354,353,'','SHUPPET is attracted by feelings\nof jealousy and vindictiveness.\nIf someone develops strong feelings of vengeance, this POKMON will appear\nin a swarm and line up beneath the eaves\nof that persons home.','fast',35,225,4),(355,354,'','BANETTE generates energy for laying\nstrong curses by sticking pins into its\nown body. This POKMON was originally a pitiful\nplush doll that was thrown away.','fast',35,45,4),(356,355,'','DUSKULL can pass through any wall no\nmatter how thick it may be.\nOnce this POKMON chooses a target, it will doggedly pursue the intended\nvictim until the break of dawn.','fast',35,190,4),(357,356,'','DUSCLOPSs body is completely hollow -\nthere is nothing at all inside.\nIt is said that its body is like a black hole. This POKMON will absorb anything\ninto its body, but nothing will ever come\nback out.','fast',35,90,4),(358,357,'','Puede volar al agitar sus grandes hojas. Reparte entre\nlos nios la codiciada fruta dulce que crece de su\ncuello.','slow',70,200,4),(359,358,'','CHIMECHO makes its cries echo\ninside its hollow body. When this\nPOKMON becomes enraged, its cries result in ultrasonic waves that have\nthe power to knock foes flying.','fast',70,45,4),(360,359,'','Every time ABSOL appears before people,\nit is followed by a disaster such as an\nearthquake or a tidal wave. As a result, it came to be known as the\ndisaster POKMON.','medium-slow',35,30,4),(361,360,'','WYNAUT can always be seen with a big,\nhappy smile on its face. Look at its tail\nto determine if it is angry. When angered, this POKMON will be\nslapping the ground with its tail.','medium',50,125,4),(362,361,'','SNORUNT live in regions with heavy\nsnowfall. In seasons without snow, such\nas spring and summer, this POKMON steals away to live quietly among\nstalactites and stalagmites deep in\ncaverns.','medium',50,190,4),(363,362,'','GLALIE has a body made of rock, which it\nhardens with an armor of ice.\nThis POKMON has the ability to freeze moisture in the atmosphere into any\nshape it desires.','medium',50,75,4),(364,363,'','SPHEAL is much faster rolling than \nwalking to get around. When groups of\nthis POKMON eat, they all clap at once to show their pleasure. Because of this,\ntheir mealtimes are noisy.','medium-slow',50,255,4),(365,364,'','SEALEO has the habit of always juggling\non the tip of its nose anything it sees\nfor the first time. This POKMON occasionally entertains\nitself by balancing and rolling a SPHEAL\non its nose.','medium-slow',50,120,4),(366,365,'','It swims through icy seas while shattering\nice floes with its large tusks. It is\nprotected by its thick blubber.','medium-slow',50,45,4),(367,366,'','CLAMPERLs sturdy shell is not only good\nfor protection - it is also used for\nclamping and catching prey. A fully grown CLAMPERLs shell will be\nscored with nicks and scratches all\nover.','slow-then-very-fast',70,255,4),(368,367,'','HUNTAILs presence went unnoticed by\npeople for a long time because it lives\nat extreme depths in the sea. This POKMONs eyes can see clearly\neven in the murky dark depths of the\nocean.','slow-then-very-fast',70,60,4),(369,368,'','   .\n     \n .','slow-then-very-fast',70,60,4),(370,369,'','RELICANTH is a POKMON species that\nexisted for a hundred million years\nwithout ever changing its form. This ancient POKMON feeds on\nmicroscopic organisms with its\ntoothless mouth.','slow',50,25,1),(371,370,'','LUVDISC live in shallow seas in the\ntropics. This heart-shaped POKMON\nearned its name by swimming after loving couples it spotted in the\noceans waves.','fast',70,225,6),(372,371,'','Dreaming of one day flying, it practices by leaping\noff cliffs every day.','slow',35,45,4),(373,372,'','Inside SHELGONs armor-like shell, cells\nare in the midst of transformation\nto create an entirely new body. This POKMONs shell is extremely heavy,\nmaking its movements sluggish.','slow',35,45,4),(374,373,'','SALAMENCE came about as a result of a\nstrong, long-held dream of growing\nwings. It is said that this powerful desire triggered a sudden mutation in\nthis POKMONs cells, causing it to\nsprout its magnificent wings.','slow',35,45,4),(375,374,'','Il dgage un champ magntique oppos  celui\nde la terre, ce qui lui permet de lviter.','slow',35,3,-1),(376,375,'','When two BELDUM fuse together, METANG\nis formed. The brains of the BELDUM are\njoined by a magnetic nervous system. By linking its brains magnetically,\nthis POKMON generates strong\npsychokinetic power.','slow',35,3,-1),(377,376,'','METAGROSS has four brains in total.\nCombined, the four brains can breeze\nthrough difficult calculations faster than a supercomputer.\nThis POKMON can float in the air by\ntucking in its four legs.','slow',35,3,-1),(378,377,'','Its entire body is made of rock.\nIf any part chips off in battle, it\nattaches rocks to repair itself.','slow',35,3,-1),(379,378,'','REGICEs body was made during an ice\nage. The deep-frozen body cant be\nmelted, even by fire. This POKMON controls frigid air of\nminus 328 degrees F.','slow',35,3,-1),(380,379,'','REGISTEEL has a body that is harder\nthan any kind of metal.\nIts body is apparently hollow. No one has any idea what this POKMON\neats.','slow',35,3,-1),(381,380,'','LATIAS is highly sensitive to the\nemotions of people. If it senses any\nhostility, this POKMON ruffles the feathers all over its body and cries\nshrilly to intimidate the foe.','slow',90,3,8),(382,381,'','LATIOS has the ability to make its foe\nsee an image of what it has seen or\nimagines in its head. This POKMON is intelligent and\nunderstands human speech.','slow',90,3,0),(383,382,'','KYOGRE has the power to create massive\nrain clouds that cover the entire sky\nand bring about torrential downpours. This POKMON saved people who were\nsuffering from droughts.','slow',0,3,-1),(384,383,'','Dicen que este Pokmon legendario simboliza la tierra.\nTras batirse en duelo con Kyogre se ech a dormir.','slow',0,3,-1),(385,384,'','RAYQUAZA lived for hundreds of millions\nof years in the earths ozone layer, \nnever descending to the ground. This POKMON appears to feed on water\nand particles in the atmosphere.','slow',0,45,-1),(386,385,'','A legend states that JIRACHI will make\ntrue any wish that is written on notes\nattached to its head when it awakens. If this POKMON senses danger, it will\nfight without awakening.','slow',100,3,-1),(387,386,'','The DNA of a space virus underwent a\nsudden mutation upon exposure to a\nlaser beam and resulted in DEOXYS. The crystalline organ on this POKMONs\nchest appears to be its brain.','slow',0,3,-1),(388,387,'','Made from soil, the shell on its\nback hardens when it drinks water.\nIt lives along lakes.','medium-slow',70,45,1),(389,388,'','It knows where pure water wells\nup. It carries fellow Pokmon there\non its back.','medium-slow',70,45,1),(390,389,'','Small Pokmon occasionally gather\non its unmoving back to begin\nbuilding their nests.','medium-slow',70,45,1),(391,390,'','It agilely scales sheer cliffs to\nlive atop craggy mountains. Its\nfire is put out when it sleeps.','medium-slow',70,45,1),(392,391,'','To intimidate attackers, it\nstretches the fire on its tail\nto make itself appear bigger.','medium-slow',70,45,1),(393,392,'','It uses a special kind of martial\narts involving all its limbs.\nIts fire never goes out.','medium-slow',70,45,1),(394,393,'','Because it is very proud, it hates\naccepting food from people. Its\nthick down guards it from cold.','medium-slow',70,45,1),(395,394,'','It lives alone, away from others.\nApparently, every one of them\nbelieves it is the most important.','medium-slow',70,45,1),(396,395,'','The three horns that extend from\nits beak attest to its power. The\nleader has the biggest horns.','medium-slow',70,45,1),(397,396,'','They flock in great numbers.\nThough small, they flap their\nwings with great power.','medium-slow',70,255,4),(398,397,'','It flies around forests and fields\nin search of bug Pokmon.\nIt stays within a huge flock.','medium-slow',70,120,4),(399,398,'','It has a savage nature. It will\ncourageously challenge foes that\nare much larger.','medium-slow',70,45,4),(400,