ion\'s equal.','medium',NULL,135,4),(904,903,'','Because of Sneasler\'s virulent poison and daunting physical\nprowess, no other species could hope to best it on the frozen\nhighlands. Preferring solitude, this species does not form packs.','medium-slow',NULL,135,4),(905,904,'','Its lancelike spikes and savage temperament have earned it the\nnickname sea fiend. It slurps up poison to nourish itself.','medium',NULL,135,4),(906,905,'','When it flies to this land from across the sea, the bitter winter\ncomes to an end. According to legend, this Pokmon\'s love\ngives rise to the budding of fresh life across Hisui.','slow',NULL,3,8),(907,906,'','Its fluffy fur is similar in composition to plants. This Pokmon frequently washes its face to keep it from drying out.','medium-slow',50,45,1),(908,907,'','Floragato deftly wields the vine hidden beneath its long fur, slamming the hard flower bud against its opponents.','medium-slow',50,45,1),(909,908,'','This Pokmon uses the reflective fur lining its cape to camouflage the stem of its flower, creating the illusion that the flower is floating.','medium-slow',50,45,1),(910,909,'','It lies on warm rocks and uses the heat absorbed by its square-shaped scales to create fire energy.','medium-slow',50,45,1),(911,910,'','The combination of Crocalors fire energy and overflowing vitality has caused an egg-shaped fireball to appear on the Pokmons head.','medium-slow',50,45,1),(912,911,'','The fiery bird changes shape when Skeledirge sings. Rumor has it that the bird was born when the fireball on Skeledirges head gained a soul.','medium-slow',50,45,1),(913,912,'','This Pokmon migrated to Paldea from distant lands long ago. The gel secreted by its feathers repels water and grime.\"','medium-slow',50,45,1),(914,913,'','These Pokmon constantly run through shallow waters to train their legs, then compete with each other to see which of them kicks most gracefully.','medium-slow',50,45,1),(915,914,'','A single kick from a Quaquaval can send a truck rolling. This Pokmon uses its powerful legs to perform striking dances from far-off lands.','medium-slow',50,45,1),(916,915,'','It searches for food all day. It possesses a keen sense of smell but doesnt use it for anything other than foraging.','medium',50,255,4),(917,916,'','Oinkologne is proud of its fine, glossy skin. It emits a concentrated scent from the tip of its tail.','medium',50,100,0),(918,917,'Fadenkugel','The ball of threads wrapped around its body is elastic enough to deflect the scythes of Scyther, this Pokmons natural enemy.','slow-then-very-fast',50,255,4),(919,918,'','It clings to branches and ceilings using its threads and moves without a sound. It takes out its prey before the prey even notices it.','slow-then-very-fast',50,120,4),(920,919,'','It has its third set of legs folded up. When its in a tough spot, this Pokmon jumps over 30 feet using the strength of its legs.','medium',20,190,4),(921,920,'','When it decides to fight all out, it stands on its previously folded legs to enter Showdown Mode. It neutralizes its enemies in short order.','medium',0,30,4),(922,921,'','It has underdeveloped electric sacs on its cheeks. These sacs can produce electricity only if Pawmi rubs them furiously with the pads on its forepaws.','medium',50,190,4),(923,922,'','When its group is attacked, Pawmo is the first to leap into battle, defeating enemies with a fighting technique that utilizes electric shocks.','medium',50,80,4),(924,923,'','This Pokmon normally is slow to react, but once it enters battle, it will strike down its enemies with lightning-fast movements.','medium',50,45,4),(925,924,'','Exhibiting great teamwork, they use their incisors to cut pieces out of any material that might be useful for a nest, then make off with them.','fast',50,150,-1),(926,925,'','The two little ones just appeared one day. The group might be a family of related Pokmon, but nobody knows for sure.','fast',50,75,-1),(927,926,'','This Pokmon is smooth and moist to the touch. Yeast in Fidoughs breath induces fermentation in the Pokmons vicinity.','medium-slow',50,190,4),(928,927,'','The pleasant aroma that emanates from this Pokmons body helps wheat grow, so Dachsbun has been treasured by farming villages.','medium-slow',50,90,4),(929,928,'','It protects itself from enemies by emitting oil from the fruit on its head. This oil is bitter and astringent enough to make someone flinch.','medium-slow',50,255,4),(930,929,'','Dolliv shares its tasty, fresh-scented oil with others. This species has coexisted with humans since times long gone.','medium-slow',50,120,4),(931,930,'','This calm Pokmon is very compassionate. It will share its delicious, nutrient-rich oil with weakened Pokmon.','medium-slow',50,45,4),(932,931,'','These Pokmon prefer to live in cities. They form flocks based on the color of their feathers, and they fight over territory.','slow-then-very-fast',50,190,4),(933,932,'','It was born in a layer of rock salt deep under the earth. This species was particularly treasured in the old days, as they would share precious salt.','medium-slow',50,255,4),(934,933,'','This Pokmon dry cures its prey by spraying salt over them. The curing process steals away the water in the preys body.','medium-slow',50,120,4),(935,934,'','Garganacl will rub its fingertips together and sprinkle injured Pokmon with salt. Even severe wounds will promptly heal afterward.','medium-slow',50,45,4),(936,935,'','Burnt charcoal came to life and became a Pokmon. Possessing a fiery fighting spirit, Charcadet will battle even tough opponents.','slow',50,90,4),(937,936,'','Armarouge evolved through the use of a set of armor that belonged to a distinguished warrior. This Pokmon is incredibly loyal.','slow',20,25,4),(938,937,'','The fiery blades on its arms burn fiercely with the lingering resentment of a sword wielder who fell before accomplishing their goal.','slow',20,25,4),(939,938,'','Tadbulb shakes its tail to generate electricity. If it senses danger, it will make its head blink on and off to alert its allies.','medium',50,190,4),(940,939,'','When this Pokmon expands and contracts its wobbly body, the belly-button dynamo in its stomach produces a huge amount of electricity.','medium',50,50,4),(941,940,'','When its wings catch the wind, the bones within produce electricity. This Pokmon dives into the ocean, catching prey by electrocuting them.','medium-slow',50,180,4),(942,941,'','Kilowattrel inflates its throat sac to amplify its electricity. By riding the wind, this Pokmon can fly over 430 miles in a day.','medium-slow',50,90,4),(943,942,'','It always scowls in an attempt to make opponents take it seriously, but even crying children will burst into laughter when they see Maschiffs face.','medium-slow',50,150,4),(944,943,'','This Pokmon can store energy in its large dewlap. Mabosstiff unleashes this energy all at once to blow away enemies.','medium-slow',50,75,4),(945,944,'','Though usually a mellow Pokmon, it will sink its sharp, poison-soaked front teeth into any that anger it, causing paralysis in the object of its ire.','medium-slow',50,190,4),(946,945,'','The color of the poisonous saliva depends on what the Pokmon eats. Grafaiai covers its fingers in its saliva and draws patterns on trees in forests.','medium-slow',50,90,4),(947,946,'','A soul unable to move on to the afterlife was blown around by the wind until it got tangled up with dried grass and became a Pokmon.','medium',50,190,4),(948,947,'','It will open the branches of its head to envelop its prey. Once it absorbs all the life energy it needs, it expels the prey and discards it.','medium',50,45,4),(949,948,'','Toedscool lives in muggy forests. The flaps that fall from its body are chewy and very delicious.','medium-slow',50,190,4),(950,949,'','These Pokmon gather into groups and form colonies deep within forests. They absolutely hate it when strangers approach.','medium-slow',50,90,4),(951,950,'','Klawf hangs upside-down from cliffs, waiting for prey. But Klawf cant remain in this position for long because its blood rushes to its head.','medium',50,120,4),(952,951,'','The more sunlight this Pokmon bathes in, the more spicy chemicals are produced by its body, and thus the spicier its moves become.','medium',50,190,4),(953,952,'','The red head converts spicy chemicals into fire energy and blasts the surrounding area with a super spicy stream of flame.','medium',50,75,4),(954,953,'','This Pokmon creates a mud ball by mixing sand and dirt with psychic energy. It treasures its mud ball more than its own life.','fast',50,190,4),(955,954,'','The body that supports the ball barely moves. Therefore, it is thought that the true body of this Pokmon is actually inside the ball.','fast',50,45,4),(956,955,'','Flittles toes levitate about half an inch above the ground because of the psychic power emitted from the frills on the Pokmons belly.','medium-slow',50,120,4),(957,956,'','It immobilizes opponents by bathing them in psychic power from its large eyes. Despite its appearance, it has a vicious temperament.','medium-slow',50,60,4),(958,957,'','It swings its handmade hammer around to protect itself, but the hammer is often stolen by Pokmon that eat metal.','medium-slow',50,190,8),(959,958,'','This Pokmon will attack groups of Pawniard and Bisharp, gathering metal from them in order to create a large and sturdy hammer.','medium-slow',50,90,8),(960,959,'','This intelligent Pokmon has a very daring disposition. It knocks rocks into the sky with its hammer, aiming for flying Corviknight.','medium-slow',50,45,8),(961,960,'','This Pokmon can pick up the scent of a Veluza just over 65 feet away and will hide itself in the sand.','medium',50,255,4),(962,961,'','It has a vicious temperament, contrary to what its appearance may suggest. It wraps its long bodies around prey, then drags the prey into its den.','medium',50,50,4),(963,962,'','It gathers things up in an apron made from shed feathers added to the Pokmons chest feathers, then drops those things from high places for fun.','slow',50,25,4),(964,963,'','It likes playing with others of its kind using the water ring on its tail. It uses ultrasonic waves to sense the emotions of other living creatures.','slow',50,200,4),(965,964,'','This Pokmon changes its appearance if it hears its allies calling for help. Palafin will never show anybody its moment of transformation.','slow',50,45,4),(966,965,'','It is said that this Pokmon was born when an unknown poison Pokmon entered and inspirited an engine left at a scrap-processing factory.','medium',50,190,4),(967,966,'','It creates a gas out of poison and minerals from rocks. It then detonates the gas in its cylindersnow numbering eightto generate energy.','medium',50,75,4),(968,967,'','Apparently Cyclizar has been allowing people to ride on its back since ancient times. Depictions of this have been found in 10,000-year-old murals.','medium-slow',50,190,4),(969,968,'','When attacked, this Pokmon will wield the tendrils on its body like fists and pelt the opponent with a storm of punches.','slow',50,25,4),(970,969,'','It absorbs nutrients from cave walls. The petals it wears are made of crystallized poison.','medium-slow',50,70,4),(971,970,'','When this Pokmon detects danger, it will open up its crystalline petals and fire beams from its conical body.','medium-slow',50,25,4),(972,971,'','It is said that a dog Pokmon that died in the wild without ever interacting with a human was reborn as this Pokmon.','medium-slow',50,120,4),(973,972,'','Houndstone spends most of its time sleeping in graveyards. Among all the dog Pokmon, this one is most loyal to its master.','medium-slow',50,60,4),(974,973,'','This Pokmon apparently ties the base of its neck into a knot so that energy stored in its belly does not escape from its beak.','medium-slow',50,100,4),(975,974,'','This species left the ocean and began living on land a very long time ago. It seems to be closely related to Wailmer.','medium-slow',50,150,4),(976,975,'','This Pokmon wanders around snowy, icy areas. It protects its body with powerful muscles and a thick layer of fat under its skin.','medium-slow',50,50,4),(977,976,'','When Veluza discards unnecessary flesh, its mind becomes honed and its psychic power increases. The spare flesh has a mild but delicious flavor.','fast',50,100,4),(978,977,'','This Pokmon is a glutton, but its bad at getting food. It teams up with a Tatsugiri to catch prey.','slow',50,25,4),(979,978,'','This is a small dragon Pokmon. It lives inside the mouth of Dondozo to protect itself from enemies on the outside.','medium-slow',50,100,4),(980,979,'','When its anger rose beyond a critical point, this Pokmon gained power that is unfettered by the limits of its physical body.','medium',50,45,4),(981,980,'','When attacked, this Pokmon will retaliate by sticking thick spines out from its body. Its a risky move that puts everything on the line.','medium',50,90,4),(982,981,'','Now that the brain waves from the head and tail are synced up, the psychic power of this Pokmon is 10 times stronger than Girafarigs.','medium',50,45,4),(983,982,'','This Pokmon uses its hard tail to make its nest by boring holes into bedrock deep underground. The nest can reach lengths of over six miles.','medium',50,45,4),(984,983,'','Only a Bisharp that stands above all others in its vast army can evolve into Kingambit.','medium',50,25,4),(985,984,'','Sightings of this Pokmon have occurred in recent years. The name Great Tusk was taken from a creature listed in a certain book.','slow',0,30,-1),(986,985,'','There has been only one reported sighting of this Pokmon. It resembles a mysterious creature depicted in an old expedition journal.','slow',0,50,-1),(987,986,'','It is possible that the creature listed as Brute Bonnet in a certain book could actually be this Pokmon.','slow',0,50,-1),(988,987,'','This Pokmon has characteristics similar to those of Flutter Mane, a creature mentioned in a certain book.','slow',0,30,-1),(989,988,'','This mysterious Pokmon has some similarities to a creature that an old book introduced as Slither Wing.','slow',0,30,-1),(990,989,'','No records exist of this Pokmon being caught. Data is lacking, but the Pokmons traits match up with a creature shown in an expedition journal.','slow',0,30,-1),(991,990,'','This Pokmon closely resembles a scientific weapon that a paranormal magazine claimed was sent to this planet by aliens.','slow',0,30,-1),(992,991,'','Its shape is similar to a robot featured in a paranormal magazine article. The robot was said to have been created by an ancient civilization.','slow',0,50,-1),(993,992,'','It is very similar to a cyborg covered exclusively by a paranormal magazine. The cyborg was said to be the modified form of a certain athlete.','slow',0,50,-1),(994,993,'','It resembles a certain Pokmon introduced in a paranormal magazine, described as the offspring of a Hydreigon that fell in love with a robot.','slow',0,30,-1),(995,994,'','This Pokmon resembles an unknown object described in a paranormal magazine as a UFO sent to observe humanity.','slow',0,30,-1),(996,995,'','It has some similarities to a Pokmon introduced in a dubious magazine as a Tyranitar from one billion years into the future.','slow',0,30,-1),(997,996,'','Frigibax absorbs heat through its dorsal fin and converts the heat into ice energy. The higher the temperature, the more energy Frigibax stores.','slow',50,45,4),(998,997,'','Arctibax freezes the air around it, protecting its face with an ice mask and turning its dorsal fin into a blade of ice.','slow',50,25,4),(999,998,'','This Pokmon blasts cryogenic air out from its mouth. This air can instantly freeze even liquid-hot lava.','slow',50,10,4),(1000,999,'','This Pokmon was born inside a treasure chest about 1,500 years ago. It sucks the life-force out of scoundrels who try to steal the treasure.','slow',50,45,-1),(1001,1000,'','Its body seems to be made up of 1,000 coins. This Pokmon gets along well with others and is quick to make friends with anybody.','slow',50,45,-1),(1002,1001,'','The grudge of a person punished for writing the kings evil deeds upon wooden tablets has clad itself in dead leaves to become a Pokmon.','slow',0,6,-1),(1003,1002,'','This Pokmon can control 100 tons of fallen snow. It plays around innocently by leaping in and out of avalanches it has caused.','slow',0,6,-1),(1004,1003,'','The fear poured into an ancient ritual vessel has clad itself in rocks and dirt to become a Pokmon.','slow',0,6,-1),(1005,1004,'','It controls flames burning at over 5,400 degrees Fahrenheit. It casually swims through the sea of lava it creates by melting rock and sand.','slow',0,6,-1),(1006,1005,'','It is possible that this is the creature listed as Roaring Moon in an expedition journal that still holds many mysteries.','slow',0,10,-1),(1007,1006,'','It has some similarities to a mad scientists invention covered in a paranormal magazine.','slow',0,10,-1),(1008,1007,'','This seems to be the Winged King mentioned in an old expedition journal. It was said to have split the land with its bare fists.','slow',0,3,-1),(1009,1008,'','Much remains unknown about this creature. It resembles Cyclizar, but it is far more ruthless and powerful.','slow',0,3,-1),(1010,1009,'','This ferocious creature is shrouded in mystery. It\'s named after an aquatic monster mentioned in an old expedition journal.','slow',0,5,-1),(1011,1010,'','Many of its physical characteristics match those of a Virizion from the future that was covered in a paranormal magazine.','slow',0,5,-1);
